""" Verify _get_session_headers returns the expected headers."""
error_message = """
Test: {} 
Expected: {}
Actual:   {}
"""
test_params = {'no_metric': {'metric': '', 'headers': NO_METRIC_HEADERS,
    'session_id': ''}, 'metric_present': {'metric': METRIC, 'headers':
    DEFAULT_SESSION_HEADERS, 'session_id': SESSION_ID}}
for test, params in test_params.items():
    request_parameters = {'metric': params['metric'], 'auth_token':
        AUTH_TOKEN, 'headers': params['headers'], 'session_id': params[
        'session_id']}
    attributes = Attributes(**request_parameters)
    expected = params['headers']
    actual = attributes._get_session_headers()
    self.assertEqual(expected, actual, error_message.format(test, expected,
        actual))
